'use strict';
let httpPdasCommunicator = require('./httpPdasCommunicator.js');
class HttpPdasCommunicatorFactory {
    isCors;
    constructor() {
        this.isCors = false;
    }
    setIsCors() {
        this.isCors = true;
    }
    createHttpPdasCommunicator(httpCommunicator) {
        return httpPdasCommunicator.create(httpCommunicator, this.isCors);
    }
}
module.exports = HttpPdasCommunicatorFactory
